import keras
from keras.datasets import mnist
import numpy as np
import  random
from sklearn.model_selection import train_test_split
from keras.layers import Conv2D, MaxPooling2D
from keras.layers import Dense, Flatten
from keras.models import Sequential

#MNIST共有60000训练数据，10000测试数据
#是否需要验证集--->>>怎么取验证集---
#我的想法是在60000中取1%即6000条作为验证集。
# 第一次的是使用测试集作为验证集，不是太好。所以就是在是需要验证集（从训练集中随机采样）、还是不需要验证集。

#随机生成10个种子数  [644, 920, 681, 636, 439, 520, 21, 420, 77, 906]
# seeds_list = []
# for i  in range(10):
#     seeds_list.append(random.randint(0,1000))
# print(seeds_list)


# 分离出训练集和测试集
(x_train, y_train), (x_test, y_test) = mnist.load_data()  # y_train 的shape：(60000,)
# 随即分理出验证集
x_train, x_val, y_train, y_val = train_test_split(x_train, y_train, test_size=0.1, random_state=7) #seed=7  这里就固定吧。
# 此时共有 54000条训练集，6000条验证集，10000条测试集


#定义随即复制变量
x_train_re = np.zeros((5400,28,28))
y_train_re = np.zeros((5400,))
#制定随机种子（就是上面的seedslist中的值），便于复现
random.seed(906)    #
ranIndexList = []
for i in range(5400):
    temp = random.randint(0,53999)
    ranIndexList.append(temp)
    x_train_re[i] = x_train[temp]
    y_train_re[i] = y_train[temp]
    # print(x_train_re.shape)  (28, 28)
print(ranIndexList)   #打印不同随机种子生成的随机采样结果。
x_train = np.concatenate((x_train_re, x_train), axis=0) # (59400,28,28)
y_train = np.concatenate((y_train_re, y_train), axis=0) # (59400,)


# 输入数据为 mnist 数据集
x_train = x_train.astype('float32').reshape(-1,28,28,1)
x_val = x_val.astype('float32').reshape(-1,28,28,1)
x_test = x_test.astype('float32').reshape(-1,28,28,1)

x_train = x_train / 255
x_val = x_val/255
x_test = x_test / 255
print('Train:{},Test:{}'.format(len(x_train),len(x_test)))
y_train = keras.utils.to_categorical(y_train, 10)
y_test = keras.utils.to_categorical(y_test, 10)
y_val = keras.utils.to_categorical(y_val,10)

model = Sequential()
model.add(Conv2D(filters=6, kernel_size=(5, 5), activation='relu',padding='valid',input_shape=(28, 28, 1)))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Conv2D(filters=16, kernel_size=(5, 5),padding='valid', activation='relu'))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Flatten())
model.add(Dense(120, activation='relu'))
model.add(Dense(84, activation='relu'))
model.add(Dense(10, activation='softmax'))
model.summary()


model.compile(loss='categorical_crossentropy', optimizer='sgd', metrics=['accuracy'])
model.fit(x_train, y_train, batch_size=128, epochs=10, verbose=1,  validation_data=(x_val, y_val))  #shuffle=True,
score = model.evaluate(x_test, y_test)
print('Test Loss: %.4f' % score[0])
print('Test accuracy: %.4f'% score[1])
model.save('LeNet_Rep_Seed906.hdf5')


